import React from "react";
import Logo from "../assets/Logo.svg"
import { link } from "react-router-dom";
const Navbar = () => {
    return (
        <div>
            <link>
                <img src={Logo}></img>
            </link>
            <nav>
                <ul>
                    <li>
                        <link to="/">Home</link>
                    </li>
                    <li>
                        <link to="/">About</link>
                    </li>
                    <li>
                        <link to="/">Contact</link>
                    </li>
                </ul>
            </nav>
        </div>
    );
}
export default Navbar;
